import react from "react";
import Card from "./Card";

const CardList = ({vegetables})=>{
    return(
            <div>
                <Card id={vegetables[0].id} name={vegetables[0].name} season={vegetables[0].season} />
                <Card id={vegetables[0].id} name={vegetables[0].name} season={vegetables[0].season} />
                <Card id={vegetables[0].id} name={vegetables[0].name} season={vegetables[0].season} />

            </div>
    );
}

export default CardList;
